import { useState } from "react";
import Button from 'react-bootstrap/Button';

function NewState()
{
    const [color, setColor] = useState("Red");

    return(
        <>
            <h1>Color {color}</h1>
            <Button variant="success" onClick={() => setColor("Blue")}>Blue</Button>
            <Button variant="success" onClick={() => setColor("Green")}>Green</Button>
            <Button variant="success" onClick={() => setColor("Brown")}>Brown</Button>
            <Button variant="success" onClick={() => setColor("Black")}>Black</Button>
        </>
    )
}

export default NewState;
